import React from "react";
import axios from 'axios';
import './Users.css';

const Users=(props)=>{
    const handleAllUsers=async(e)=>{
        e.preventDefault();
     
        try{
         const response=await axios.get('http://localhost:8081/users/all')
         console.log(response);
      
        }
        catch(e){console.log(e);}
    
    };

    return(
        <>
         <div className="header" >
           <a href="" className="logo">Just Tweet it !</a>

           <div className="header-left">
              <a href="" > Tweets </a>
              <a href="" className="active"> Users </a>
           </div>
            <div className="header-right">
                <a href="" >Logout</a>
            </div>      
       </div>

       <div onClick={handleAllUsers}>
           <div><button type='button'>All users</button></div>
           <ul>

           </ul>
       </div>
        </>
    )
}

export default Users;
